import Aleatorio from './components/Aleatorio'

export default () => (
    <div id="app">
        <h1>Fundamentos React</h1>
        <Fragments />
        <ComParametro
            titulo="Segundo componente"
            subtitulo="Muito legal"
        />
        <Primeiro></Primeiro>
        <Aleatorio min={1} max={60} />
    </div>
);
